import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';
import './StudentProfile.css';
import image from './Assets/logo.png';

function ProfilePage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { student } = location.state || {};
  const [loading,setLoading] = useState(true)
  const [recommendations, setRecommendations] = useState([]);
  const [editableStudent, setEditableStudent] = useState(student);
  const [isEditing, setIsEditing] = useState(false);

  const handleReturn = () => {
    navigate('/app');
  };

  const handleDelete = async () => {
    const confirmDelete = window.confirm("Are you sure you want to delete this student?");
    if (confirmDelete) {
      try {
        await fetch(`http://localhost:5002/api/data/${student._id}`, {
          method: 'DELETE',
        });
        alert('Student deleted successfully.');
        navigate('/app');
      } catch (error) {
        console.error('Error deleting student:', error);
        alert('Failed to delete student.');
      }
    }
  };

  const handleEditToggle = () => {
    setIsEditing(!isEditing);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith('score.')) {
      const [_, subject] = name.split('.');
      setEditableStudent((prev) => ({
        ...prev,
        score: {
          ...prev.score,
          [subject]: value,
        },
      }));
    } else {
      setEditableStudent((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSave = async () => {
    console.log('Saving data:', editableStudent);
    try {
      const response = await fetch(`http://localhost:5002/api/data/${student._id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(editableStudent),
      });

      if (response.ok) {
        alert('Student details updated successfully.');
        setIsEditing(false);
      } else {
        alert('Failed to update student details.');
      }
    } catch (error) {
      console.error('Error updating student:', error);
      alert('Failed to update student.');
    }
  };
  useEffect(() => {
    const fetchRecommendations = async () => {
        try {
            const {
                studentid = 'default_id',
                studentname = 'default_name',
                year = 'default_year',
                department = 'default_department',
                section = 'default_section',
                gender = 'default_gender',
                maxfee = 0,
                emailid = 'default_email@example.com',
                arrearstatus = 'No',
                preferreddegree = 'default_degree',
                preferredcourse = 'default_course',
                preferredcountry = 'default_country',
                score = { GATE_SCORE: 0, GRE_SCORE: 0, TOEFL_SCORE: 0, IELTS_SCORE: 0, GMAT_SCORE: 0, SAT_SCORE: 0 }, // add your default score attributes here
            } = editableStudent || {};

            const response = await fetch('http://localhost:8000/predict-eligible-colleges/', { // updated URL to match your backend
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    PROGRAM: 'default_program', // Add default values for the model
                    TUTION_FEE: maxfee,
                    SCHOLARSHIP_AVAL: 0,
                    PROGRAM_DURATION: 3,
                    COUNTRY: preferredcountry,
                    LIVING_COST: 0,
                    ALUMINI_NETWORK: 0,
                    GATE_SCORE: score.gatescore,
                    GRE_SCORE: score.grescore,
                    TOEFL_SCORE: score.toeflscore,
                    IELTS_SCORE: score.ieltsscore,
                    GMAT_SCORE: score.gmatscore,
                    SAT_SCORE: score.satscore,
                    CGPA: cgpa,
                    DEGREE: preferreddegree,
                    MAJOR: preferredcourse,
                    ACHIVEMENT: 0,
                    PROJECTS: numberofprojects,
                    N_PAPERS: numberofresearchpapers,
                }),
            });

            if (response.ok) {
                const recommendationsData = await response.json();
                setRecommendations(recommendationsData);
            } else {
                console.error('Failed to fetch recommendations');
            }
        } catch (error) {
            console.error('Error fetching recommendations:', error);
        }
    };

    fetchRecommendations();
}, [editableStudent]);


  if (!editableStudent) {
    return <div>No student data available.</div>;
  }

  return (
    <>
      <div className="header">
        <img src={image} alt="logo" />
      </div>
      <div className="title">
        <h2>Higher Studies Students Data</h2>
      </div>
      <div className="profile-container">
          <div className='profile-details-container'>
          <div className="profile-header">
            <h1>{isEditing ? (
              <input
                type="text"
                name="studentname"
                value={editableStudent.studentname}
                onChange={handleChange}
              />
            ) : (
              editableStudent.studentname
            )}</h1>
          </div>
          <div className="profile-details">
            {Object.keys(editableStudent).map((key) => (
              key !== 'score' && key !== '_id' && (
                <div key={key} className='detail-row'>
                  <div className="detail-label">{key}</div>
                  <div className="detail-data">
                    {isEditing ? (
                      <input
                        type="text"
                        name={key}
                        value={editableStudent[key]}
                        onChange={handleChange}
                      />
                    ) : (
                      editableStudent[key]
                    )}
                  </div>
                </div>
              )
            ))}
            <div className="score">
              <h3 className='score-heading'>score</h3>
              {Object.entries(editableStudent.score || {}).map(([subject, score]) => (
                <div key={subject} className='detail-row'>
                  <div className="detail-label">
                    {subject}
                  </div>
                  <div className='detail-data'>
                    {isEditing ? (
                      <input
                        type="text"
                        name={`score.${subject}`}
                        value={score}
                        onChange={handleChange}
                      />
                    ) : (
                      score
                    )}

                  </div>
                </div>
              ))}
            </div>
          </div>
          <div className='button'>
            <div>
              {isEditing ? (
                <button onClick={handleSave} className='save-button'>Save</button>
              ) : (
                <button onClick={handleEditToggle} className='edit-button'>Edit</button>
              )}
            </div>
            <div>
              <button onClick={handleReturn} className="return-button">Return to List</button>
            </div>
            <div>
              <button onClick={handleDelete} className='delete-button'>Delete</button>
            </div>
          </div>
        </div>
        <div className="recommendations-container">
          <div className="recommendations">
              <h3>Recommended Colleges</h3>
              {recommendations.length > 0 ? (
                  <ul>
                      {recommendations.map((college, index) => (
                          <li key={index}>
                              <h4>{college.college_name}</h4>
                              <p>Education Probability: {college.education_probability}</p>
                              <p>Financial Probability: {college.financial_probability}</p>
                              <p>Overall Probability: {college.overall_probability}</p>
                          </li>
                      ))}
                  </ul>
              ) : (
                  <div className="no-recommendations">{loading ? (<p>Loading...</p>) : (<p>No recommendations available yet.</p>)}</div>
              )}
          </div>
        </div>
      </div>
    </>
  );
}

export default ProfilePage;
